)
BEGIN
	if P_ID_TTP < 0 then
		select ID_TINH_TP,TEN_TINH_TP,ST_AsGeoJSON(POLYGON) as POLYGON
        from tinh_tp;
    else
		select ID_TINH_TP,TEN_TINH_TP,ST_AsGeoJSON(POLYGON) as POLYGON
